import './App.css';

const App = () => {
	return (
		<div>
			<table>
				<tr>
					<td className="1-0-0">1</td>
					<td className="0-2-0">2</td>
					<td className="0-0-3">3</td>
				</tr>
				<tr>
					<td className="4-0-0">4</td>
					<td className="0-5-0">5</td>
					<td className="0-0-6">6</td>
				</tr>
				<tr>
					<td className="7-0-0">7</td>
					<td className="0-8-0">8</td>
					<td className="0-0-9">9</td>
				</tr>
			</table>
		</div>
	);
};

export default App;
